/**
 * @param {string} s
 * @return {number}
 */
var numberOfSubstrings1 = function(s) {
    let ret = 0;
    for(let i = 0;i<s.length-2;i++){
        // let tempRet = 0;
        let findA = -1;
        let findB = -1;
        let findC = -1;
        for(let j=i;j<s.length;j++){
            if(s[j] == 'a'){
                findA = j;
            } else if(s[j] == 'b'){
                findB = j;
            } else if(s[j] == 'c'){
                findC = j;
            }
            if(findA>=0 && findB>=0 && findC>=0){
                let last = Math.min(findA,findB,findC);
                ret += (s.length - j)*(last-i+1);
                i = last;
                break;
            }
        }
        if(findA>=0 && findB>=0 && findC>=0){
        } else {
            break;
        }   
    }
    return ret;
};

var numberOfSubstrings2 = function(s) {
    let ret = 0;
    for(let i = s.length-1;i>=2;i--){
        // let tempRet = 0;
        let findA = 0;
        let findB = 0;
        let findC = 0;
        for(let j=i;j>=0;j--){
            if(s[j] == 'a'){
                findA = 1;
            } else if(s[j] == 'b'){
                findB = 1;
            } else if(s[j] == 'c'){
                findC = 1;
            }
            if(findA && findB && findC){
                ret += j+1;
                break;
            }
        }
        if(findA && findB && findC){
        } else {
            break;
        }   
    }
    return ret;
};

